import { ProductDescription} from "../product/productDescription1";



export const ProdottoList = ({ prodotti = [] }) => {
  return (
    <div>

      <ul>
        {prodotti.map((v, index) => {
          return (

              <ProductDescription
                key={index}
                title={v.title}
                about={v.about}
                size={v.size}
                price={v.price}
              />

          );
        })}
      </ul>
    </div>
  );
};
